Jimmy Vickers (Danny Dyer), de verhoorrechercheur van een speciale eenheid, spoort de bende op die zijn ouders heeft afgeslacht. Met de politie en zijn oude eenheid op de hielen moet hij er voor zien te zorgen net zo lang uit hun handen te blijven totdat hij zijn gruwelijke missie voltooid heeft.


